import React from 'react';
import './App.css'

function Cards(props){
  return(
    <>
      <div className="Card" style={Cardcss}>
        <img src={props.src} width='100%' height='70%'/>

        <div className="CardInfo">
          <div className="title" 
          style={{color:"Black",textAlign:'center',margin:'10px 0 10px 0',
          fontWeight:"800",fontFamily:"sans-serif"}}>
          <h2>{props.title}</h2>
        </div>
          <button style={btnCss}><a target="_blank"style={{textDecoration:"none",color:"white"}} href={props.link}>Watch Now</a></button>
        </div>

      </div>
    </>
  )
}
export default Cards;
